  true,\n\t\"url\": null,\n\t\"notes\": \"<p>NNDSS - Table II. Spotted Fever Rickettsiosis
  to Syphilis - 2015.In this Table, provisional cases of selected notifiable diseases
  (u00e2u0089u00a51,000 cases reported during the preceding year), and selected low
  frequency diseases are displayed. The Table includes total number of cases reported
  in the United States, by region and by states, in accordance with the current method
  of displaying MMWR data.  Data on United States exclude counts from US territories.
  Note:These are provisional cases of selected national notifiable diseases, from
  the National Notifiable Diseases Surveillance System (NNDSS). NNDSS data reported
  by the 50 states, New York City, the District of Columbia, and the U.S. territories
  are collated and published weekly as numbered tables printed in the back of the
  Morbidity and Mortality Weekly Report (MMWR). Cases reported by state health departments
  to CDC for weekly publication are provisional because of ongoing revision of information
  and delayed reporting. Case counts in this table are presented as they were published
  in the MMWR issues. Therefore, numbers listed in later MMWR weeks may reflect changes
  made to these counts as additional information becomes available. Footnotes:C.N.M.I.:
  Commonwealth of Northern Mariana Islands. U: Unavailable.    -: No reported cases.
  \   N: Not reportable.    NN: Not Nationally Notifiable.    NP: Nationally notifiable
  but not published.    Cum: Cumulative year-to-date counts.    Med: Median.    Max:
  Maximum. * Three low incidence conditions, rubella, rubella congenital, and tetanus,
  have been moved to Table 2 to facilitate case count verification with reporting
  jurisdictions. u00efu00bfu00bdu00efu00bfu00bdu00efu00bfu00bd Case counts for reporting
  year 2015 are provisional and subject to change. For further information on interpretation
  of these data, see <a href=\"http://wwwn.cdc.gov/nndss/document/ProvisionalNationaNotifiableDiseasesSurveillanceData20100927.pdf\">http://wwwn.cdc.gov/nndss/document/ProvisionalNationaNotifiableDiseasesS...</a>.
  Data for TB are displayed in Table IV, which appears quarterly. u00efu00bfu00bdu00efu00bfu00bd
  Illnesses with similar clinical presentation that result from Spotted fever group
  rickettsia infections are reported as Spotted fever rickettsioses. Rocky Mountain
  spotted fever (RMSF) caused by Rickettsia rickettsii, is the most common and well-known
  spotted fever.</p>n\",\n\t\"license_title\": \"Other License Specified\",\n\t\"extras\":
